INSERT INTO `articles` VALUES (1,4,'Les Maladies Cardiovasculaires','https://res.cloudinary.com/amazing-technologies/image/upload/v1552240638/article_thumbnails/bisa_article_thumbnail_1552240638.jpg','Cela paraît être une seule maladie mais une maladie cardiovasculaire représente en effet un groupe de plus de 60 désordres du cœur ou du système vasculaire (les artères, les capillaires et les veines) au sein du corps entier d’une personne. La tension artérielle, la maladie cardiaque et l’attaque d’apoplexie sont les formes les plus communes. Dépendant de la condition spécifique, le traitement de la maladie cardiovasculaire peut inclure la prise des médicaments, le changement de mode de vie ou l’observation des procédures spéciales.\r\n\r\nQu’est-ce que c’est qu’une maladie cardiovasculaire ?\r\n\r\nLa maladie cardiovasculaire (MCV) fait allusion à l’ensemble des maladies qui affecte le cœur ou le système vasculaire au sein du corps entier de quelqu’un. Ce n’est pas une seule maladie ou une seule condition. Plutôt, c’est un groupe de plus de 60 désordres différents.\r\n\r\nLe Système Cardiovasculaire et la Maladie Cardiovasculaire\r\n\r\nLe cœur est une pompe forte et musculaire qui est un peu plus grand que votre poing. Elle pompe le sang continuellement à travers le système cardiovasculaire. C’est-à-dire, le réseau de tubes élastiques qui permettent au sang de couler tout à travers le corps. Ce système comprend le cœur et aussi les vaisseaux sanguins (les artères, les capillaires et les veines). Les artères et les capillaires transportent le sang riche en oxygène et en nutriments du cœur et des poumons à toutes les parties du corps. Les veines transportent le sang contenant un niveau diminué d’oxygène et de nutriments au cœur et aux poumons.\r\n\r\nLes problèmes cardiaques et vasculaires n’arrivent pas rapidement. Au cours du temps, les artères qui apportent le sang au cœur et au cerveau peuvent être bloquées à cause de l’accumulation des cellules, de la graisse et du cholestérol. Cette accumulation s’appelle la plaque. L’écoulement diminué du sang au cœur (dû aux blocages dans les artères) provoque des crises cardiaques. L’incapacité du sang de couler au cerveau en raison d’un caillot sanguin ou d’un saignement dans le cerveau à cause d’un vaisseau sanguin brisé provoque une attaque d’apoplexie.\r\n\r\nLa Maladie Cardiaque versus La Maladie Cardiovasculaire\r\n\r\nLa maladie cardiovasculaire et la maladie cardiaque sont différentes. La maladie cardiaque fait allusion seulement aux maladies du cœur et du système vasculaire dans le cœur. La maladie cardiovasculaire fait allusion aux maladies du cœur et les maladies du système vasculaire entier (les artères, les capillaires et les veines) au sein du corps de quelqu’un, tel que le cerveau, les bras, les jambes et les poumons. « Cardio » fait allusion au cœur, et « vasculaire » fait allusion au système des vaisseaux du sang. Alors, la maladie cardiaque est un type de la maladie cardiovasculaire.\r\n\r\nLes Types de Maladie Cardiovasculaire\r\n\r\nIl y a plus de 60 types de maladie cardiovasculaire. Il y a certaines personnes qui sont nées avec cela; il y en a d’autres qui la manifestent au fil de leurs vies. Voici quelques maladies cardiovasculaires :\r\n\r\nL’athérosclérose (l’endurcissement des artères)\r\nLa maladie coronarienne (c’est populairement désigné ‘la maladie cardiaque’)\r\nL’angine\r\nLa crise cardiaque\r\nL’attaque d’apoplexie\r\nLa tension artérielle (aussi appelé l’hypertension)\r\nL’insuffisance cardiaque congestive\r\nLes Symptômes de la Maladie Cardiovasculaire\r\n\r\nLa maladie cardiovasculaire peut provoquer des symptômes allant de la douleur à la poitrine jusqu’à l’engourdissement soudain du visage ou des bras. Il y a plus de 60 formes de maladie cardiovasculaire donc il est peu probable d’avoir les mêmes symptômes dans tous les cas. En général, les symptômes arrivent plus fréquemment dans le cœur et le cerveau ainsi que dans les jambes, le pelvis ou les bras.\r\n\r\nUne Introduction aux Signes et aux Symptômes de la Maladie Cardiovasculaire\r\n\r\nLa maladie cardiovasculaire n’est pas une seule condition. Plutôt, c’est un nom qui est utilisé pour décrire les conditions et les maladies qui affectent le cœur (‘cardio’) et les vaisseaux sanguins (‘vasculaire’) tout à travers le corps. Il y a plus de 60 types de maladie cardiovasculaire allant de la maladie coronarienne commune jusqu’à la tétralogie de Fallot qui est peu connue. Certaines conditions cardiovasculaires sont présentes à la naissance alors que d’autres se manifestent au fil de beaucoup d’années. En parlant des symptômes de la maladie cardiovasculaire, ce n’est pas possible d’en faire une liste parce que chaque condition peut avoir plusieurs symptômes différents.\r\n\r\nCela dit, alors que la maladie cardiovasculaire peut se manifester dans n’importe quelle partie du corps, elle a la tendance de se manifester plus fréquemment :\r\n\r\nAu cœur\r\nAu cerveau\r\nAux jambes\r\nAu pelvis\r\nAux bras\r\nLes Symptômes qui Affectent le Cœur\r\n\r\nIl y a un nombre de types différents de maladie cardiaque. Le plus commun est la maladie coronarienne (également appelée la maladie des artères coronaires). La maladie coronarienne est la première cause de la mort aux Etats-Unis. Si les artères qui fournissent le sang au cœur, appelées les artères coronaires, sont atteintes de la maladie coronarienne, on peut avoir des symptômes tels que :\r\n\r\nLa douleur ou le malaise thoracique (l’angine)\r\nLa douleur à un ou aux deux bras, à l’épaule gauche, au cou, au menton ou au dos\r\nL’essoufflement\r\nLes étourdissements\r\nDes battements plus rapides du cœur\r\nLa nausée (le fait de se sentir mal au ventre)\r\nLes battements anormaux du cœur\r\nLa fatigue',0,0,0,1,'2019-03-10 17:21:07','2019-03-10 17:57:19'),(2,5,'Pourquoi vous devez faire un test de dépistage du VIH?','https://res.cloudinary.com/amazing-technologies/image/upload/v1552240625/article_thumbnails/bisa_article_thumbnail_1552240624.jpg','Si le résultat est positif :\r\n\r\nVous pouvez prendre le traitement pour vivre une vie longue, saine et productive.\r\nVous pouvez prendre des mesures préventives pour protéger votre partenaire ou votre époux/épouse.\r\nVous pouvez continuer à travailler et à accomplir vos buts professionnels.\r\nVous pouvez  avoir des enfants qui ne seront pas nés avec le VIH.\r\nSi le résultat est négatif :\r\n\r\nVous arrêtez de vous inquiéter mais méfiez-vous de ne pas être atteint du VIH.\r\nPlus de 18 millions de personnes atteintes du VIH prennent le traitement antirétroviral et elles vivent une vie saine.\r\n\r\nSouvenez-vous que :\r\n\r\nL’infection par le VIH passe inaperçue pour des années puisqu’il n’y en existe pas de symptômes immédiats et exclusifs. Vous ne devez pas tomber malade avant de vous faire dépister.\r\n\r\nActrice Kavi Ladnier raconte l’histoire de Seema, qui a appris l’importance de se faire dépister tôt du VIH après son fils est tombé malade: http://bit.ly/29P5lpx\r\nActrice Ratidyo Mambo raconte l’histoire vécue d’une femme qui était forcée à révéler son statut VIH au travail: http://bit.ly/29P5tW8\r\nActeur Junes Zadhi raconte l’histoire de Khaled, qui était ostracisé de sa communauté à cause du #VIH : http://bit.ly/29vaViZ\r\nMédaillé d’Or Olympique @greglouganis demande la terminaison de la discrimination au travail due au VIH. http://bit.ly/29xM9u8\r\nActrice Mariana Renata collabore avec @ILO pour promouvoir la thérapie et le dépistage volontaires du VIH pour les travailleurs : http://bit.ly/29EQxxd\r\nEst-ce que le dépistage du VIH est confidentiel?\r\n\r\nOui. Personne ne saura le résultat excepté vous. Dans certains hôpitaux, on utilise un code (pas votre nom réel) afin que personne ne puisse lier un résultat à vous. Il y a des professionnels et des travailleurs fiables dans le domaine de la santé aux centres de dépistage qui peuvent vous aider avec tous vos soucis. N’hésitez pas de les consulter confidentiellement.\r\n\r\nSelon la recommandation de l’Organisation International du Travail sur le VIH/SIDA et le monde du travail, on doit garder la confidentialité en ce qui concerne le statut VIH aux lieux de travail. Et aussi, il ne faut pas discriminer en raison du statut VIH réel ou perçu.\r\n\r\nQuelles sont les directives au Ghana?\r\n\r\nLa POLITIQUE NATIONALE 2013 SUR LE VIH, LE SIDA ET LES MST prohibe « Le dépistage et le traitement obligatoire ». Cette politique est complétée par la Politique Nationale du Ghana 2012 sur le VIH au lieu de travail qui prohibe le dépistage avant l’emploi, y compris : « le dépistage indirect du VIH ou l’interrogation sur les dépistages déjà faits » et elle déclare que « cependant, le dépistage volontaire confidentiel et la thérapie doivent être encouragé ».\r\n\r\nSPONSORISE PAR NOTRE PARTENARIAT AVEC L’ORGANISATION INTERNATIONAL DU TRAVAIL',0,0,0,1,'2019-03-10 17:22:34','2019-03-10 17:57:05'),(3,1,'La raison pour se débarrasser de l’automédication pendant la grossesse','https://res.cloudinary.com/amazing-technologies/image/upload/v1552240610/article_thumbnails/bisa_article_thumbnail_1552240609.jpg','On examine Audrey. Elle est en travail. Le taux du battement du cœur du fœtus est faible et inaudible, n’ayant pas de rythme constant, les contractions utérines sont excessives et la fluide amniotique est verte (tachée de méconium) et offensive. Ayant reçu plus de traitement peu de minutes après l’examen initial, elle a envie de pousser. Le col utérin s’est dilaté complètement. Cela était mon premier cas d’une MORTINATALITE. Un beau bébé a expiré, les interventions des infirmières pour ressusciter le bébé étaient sans succès. C’était un grand choc pour Audrey et son mari. Ils ont perdu une fois encore un bébé et cette fois-ci, c’était une fille. C’est très blessant!\r\n\r\nQu’est-ce qui a provoqué cette mortinatalité? Dans le cas d’Audrey, c’était L’AUTOMEDICATION LORS DE SA GROSSESSE. Elle s’est administrée des concoctions de lavement à plusieurs reprises quelques semaines avant l’accouchement. Elle faisait cela à dessein de précipiter l’arrivée de la période d’accouchement et de diminuer les douleurs de l’accouchement mais l’effet était plutôt contraire.\r\n\r\nIl n’y a pas de grossesse sans des occurrences mineures d’indisposition et il n’y a pas de travail sans douleurs; il y en a plein. Est-ce que vous avez considéré que cela peut vous arriver? Ne restez pas inactif jusqu’à ce que vous expérimentiez cela. Ce n’est pas du tout agréable.\r\n\r\nLes indispositions mineures lors de la grossesse peuvent être traitées efficacement en prenant des médicaments ordonnés par un médecin professionnel qualifié ou par une sage-femme. Il y en a certaines qu’on peut traiter sans le besoin de prendre un médicament. L’administration du lavement ou la consommation des concoctions et même l’achat des multivitamines sans ordonnance est très nuisible parce que le faux dosage de tels médicaments n’amènent pas la guérison mais plutôt la prolongation du rétablissement. L’overdose peut nuire à certains organes vitaux comme le foie. Certains médicaments ont un effet tératogène qui affecte de façon négatif le bébé qui grandit dans le sein.\r\n\r\nA part le fait que la mortinatalité est une complication liée à l’automédication lors de la grossesse,\r\n\r\nil y a une haute possibilité de l’occurrence d’une fausse couche et si les complications sont sévères, cela peut également avoir un effet négatif sur la possibilité de concevoir à l’avenir.\r\nElle peut empêcher la croissance et le développement normal du bébé dans le sein à n’importe quel stade de la grossesse.\r\nElle peut aussi provoquer des fistules dans la femme lorsqu’elle est en travail puisque de tels médicaments augmentent excessivement les contractions utérines provoquant donc l’accouchement précipité.\r\nA cause du mauvais diagnostic d’une maladie, un problème mineur de santé qui pourrait être résolu facilement avec le conseil médical peut évoluer en un problème majeur au fil du temps.\r\nElle peut provoquer la dépendance.\r\nNe négligez pas de mettre votre prestataire de soin de santé au courant de toute chose qui a affaire avec votre santé.\r\n\r\nSuivez toutes les mesures préventives quelle que soit la maladie afin d’empêcher le besoin pour l’augmentation du dosage des médicaments.',0,0,0,1,'2019-03-10 17:23:47','2019-03-10 17:56:50'),(4,2,'POUR UN BEAU SOURIRE: 7 REMEDES NATURELS DE GRAND-MERE POUR BLANCHIR LES DENTS','https://res.cloudinary.com/amazing-technologies/image/upload/v1552240595/article_thumbnails/bisa_article_thumbnail_1552240595.jpg','Il n’y a personne qui veut un sourire jaune, mais si vous avez bien fait attention au fil de ces années passées, vous rendrez compte que les sourires sont devenus progressivement plus blancs. Ces jours-ci, ce n’est pas inhabituel de voir une vedette, un journaliste ou une personne d’autre qui s’intéresse particulièrement à son apparence, ayant des dents si blancs que c’est tout à fait distrayant. Est-ce que vous voulez un sourire qui ‘illumine la salle’? Quel que soit le degré auquel vous voulez que vos dents blanchissent, il y a beaucoup de remèdes naturels de grand-mère pour blanchir les dents afin d’avoir un beau sourire. En plus, le blanchissement des dents chez vous est super facile.\r\n\r\nLa décoloration des dents fait partie du processus de vieillissement. Mais juste comme les rides, beaucoup de personnes luttent contre cela. Alors que c’est normal de voir les dents évoluer un peu au cours des années, il y a des choses que vous pouvez faire pour éviter les taches et la décoloration embarrassante – et heureusement, ces solutions naturelles de grand-mère pour blanchir les dents n’exigent pas de gouttières de blanchiment coûtant de centaines de dollars, de visites chez le dentiste ou de solutions chimiques inconnues.\r\n\r\n \r\n\r\n7 Remèdes Naturels de Grand-Mère pour Blanchir les Dents – Le Blanchissement des Dents Rendu Facile Chez Vous\r\n\r\nMangez des Fraises\r\nIl est prouvé que les fraises peuvent aider à blanchir les dents à cause du fait qu’elles contiennent une enzyme appelée l’acide malique et la vitamine C. L’astringent qui se trouve dans les fraises aide à ôter des taches superficielles alors que la vitamine C efface la plaque. L’action de mâcher un peu de fraises et de vous brosser les dents avec la mixture une ou deux fois par semaine peut produire des résultats positifs. Aussi, vous pouvez seulement manger les fraises en assurant que vous les mastiquez très bien afin de les permettre à brosser les dents toutes seules.\r\n\r\nUtilisez le Fil Dentaire\r\nPour certaines raisons, il y a des personnes qui ne trouvent pas l’usage du fil dentaire facile à utiliser par rapport au brossage des dents. Cependant, il y a des dentistes et des hygiénistes qui sont toujours d’accord que le fait d’utiliser le fil dentaire est plus important que le fait de se brosser les dents. Utilisez le fil dentaire deux fois par jour pour obtenir les meilleurs résultats en ce qui concerne votre santé dentaire. Le fait de vous nettoyer les dents au fil dentaire peut facilement ôter les taches entre les dents, les aidant alors à paraître plus blancs.\r\n\r\nLe Bicarbonate de Soude et le Citron\r\nCe remède est probablement un des plus connus remèdes naturels de grand-mère pour blanchir les dents. La réaction chimique du bicarbonate de soude avec l’agrume dans le jus de citron a pour effet l’égaiement du sourire. Chacun de ses ingrédients marche bien par soi mais en les combinant, ce sont super-efficaces. Brossez-vous les dents avec cette solution seulement une fois par semaine puisqu’elle peut éroder l’émail dentaire si c’est utilisé trop fréquemment. S’il arrive que vous ayez une irritation, cela indique que le bicarbonate de soude est possiblement trop abrasif pour vos gencives et donc vous avez à cesser de vous en servir.  Si vous craignez nuire à l’email de vos dents, veuillez essayer un autre remède.\r\n\r\nMélangez un peu de bicarbonate de soda et du jus de citron pressé dans un bol. La mixture doit faire un peu de bulles. Essuyez vos dents avec un tampon pour enlever la salive et la plaque excessive avant d’appliquer la mixture. Laissez la mixture sur les dents pour une minute et après, enlevez-la en la brossant avec une brosse à dents.\r\n\r\nNe laissez pas la mixture sur les dents pour une durée excédant une minute; l’acide érode l’email des dents.',0,0,0,1,'2019-03-10 17:25:07','2019-03-10 17:56:35'),(5,3,'LES BAGAGES LOURDS PEUVENT CAUSER DU DOS, DU COU ET DE LA SOUCHE DE L’EPAULE','https://res.cloudinary.com/amazing-technologies/image/upload/v1552240578/article_thumbnails/bisa_article_thumbnail_1552240577.jpg','Selon l’Académie américaine des chirurgiens orthopédiques (AAOS), les bagages surchargés peuvent parfois causer des problèmes de santé.\r\n\r\nUtilisez plutôt quelques sacs plus petits\r\n\r\n“Les individus courent un risque élevé de maux de dos, de nuque et d’épaules lorsqu’ils manipulent des bagages lourds avec négligence”, a déclaré le Dr Nitin Khanna, chirurgien orthopédiste et porte-parole de l’AAOS, dans un communiqué de presse de l’académie.\r\n\r\n«Soyez toujours conscient de la façon dont vous soulevez des bagages lourds pour éviter des blessures douloureuses», a conseillé Khanna.\r\n\r\nEn 2014, les Américains ont subi près de 73 000 blessures liées aux bagages, selon la Commission américaine de sécurité des produits de consommation.\r\n\r\nLire: Conseils santé pour les vacances\r\n\r\nLorsque vous magasinez pour un nouveau bagage, recherchez une pièce solide et légère avec des roues et une poignée, a déclaré AAOS. Emballez légèrement. Si possible, mettez les articles dans quelques petits sacs plutôt que dans un gros bagage.\r\n\r\nNe tordez jamais votre corps lorsque vous transportez ou soulevez un bagage. Au lieu de cela, pointez vos orteils dans la direction dans laquelle vous vous dirigez, puis tournez tout votre corps dans cette direction.\r\n\r\nNe vous précipitez pas lorsque vous portez ou soulevez un bagage. Si elle est trop lourde ou si sa forme est inconfortable, demandez de l’aide.\r\n\r\nNe transportez pas de bagages lourds pendant de longues périodes. Vérifiez les bagages lourds plutôt que de les transporter dans un bus, un train ou un avion, a déclaré l’AAOS.\r\n\r\nLorsque vous soulevez des bagages sur des plates-formes ou dans le coffre d’une voiture, pliez les genoux, soulevez-les avec vos jambes et maintenez-les près du corps. Lorsque vous placez vos bagages dans un compartiment à bagages, soulevez-les d’abord sur le dessus du siège, puis agrippez-les des deux côtés et soulevez-les.\r\n\r\nSi vous utilisez un sac à dos, il devrait comporter deux bretelles réglables et matelassées ainsi que plusieurs compartiments où vous pourrez ranger des articles de tailles différentes. Utilisez les deux sangles d’épaule lorsque vous portez le sac à dos, selon AAOS.\r\n\r\nREF: HEALTH24',0,0,0,1,'2019-03-10 17:26:18','2019-03-10 17:56:18'),(6,4,'QU’EST-CE QUE C’EST QUE LE DIABETE ET COMMENT SAURAI-JE QUE J’EN AI ?','https://res.cloudinary.com/amazing-technologies/image/upload/v1552240540/article_thumbnails/bisa_article_thumbnail_1552240540.jpg','Le diabète est une condition à longue terme dans lequel le taux de sucre dans le sang d’une personne est trop élevé. Il y a 2 types différents de diabète.\r\n\r\nLe diabète de type 1 – C’est le cas où le corps attaque les cellules qui produisent l’insuline, provoquant la situation où peu d’insuline est produite. Environ 10% seulement des diabétiques sont atteints du diabète de type 1 et cela se développe souvent au début de l’âge adulte.\r\nLe diabète de type 2 – La plupart des cas (˜90%) du diabète sont ceux du type 2. Dans ce cas, le corps ne produit pas assez d’insuline et/ou les cellules du corps ne réagissent pas à l’insuline. Les gens qui ont du poids en excès ou qui sont obèses courent le plus grand risque de souffrir du diabète de type 2.\r\nLes Symptômes\r\n\r\nLe diabète peut rester non-diagnostiqué pour de longues périodes parce que les symptômes sont souvent très courants et faciles à ignorer. Cependant, si vous expérimentez n’importe quel des symptômes suivants, vous devez consulter votre médecin. Les symptômes les plus communs comprennent :\r\n\r\nLe soif extrême\r\nLe fait d’uriner plus fréquemment que d’habitude, surtout pendant la nuit\r\nLa perte de poids et de masse musculaire\r\nLa fatigue\r\nLa vue trouble\r\nLa dysfonction sexuelle chez les hommes\r\nLe traitement et le mode de vie\r\n\r\nSi vous avez du diabète, c’est important de maintenir une vie saine, y compris l’exercice physique régulier et une alimentation saine, afin de prévenir le développement d’autres complications dues à votre diabète. Les gens souffrant du diabète de type 1 auront besoin des injections d’insuline pour le reste de leurs vies alors que ceux qui ont le diabète de type 2 auront aussi à prendre des médicaments au fur et à mesure que leur maladie évolue.\r\n\r\nL’incapacité de contrôler le taux de sucre dans votre sang peut provoquer le développement des complications à long terme au cœur, aux yeux, aux nerfs, aux rognons, à la peau et aux pieds. Dans les pires situations, les patients diabétiques peuvent être atteints de la maladie cardiovasculaire, devenir aveugle ou auront besoin de l’amputation d’un membre, parmi d’autres problèmes.',0,0,0,1,'2019-03-10 17:28:50','2019-03-10 17:55:41'),(10,5,'DES ASTUCES POUR AVOIR UN CŒUR SAIN','https://res.cloudinary.com/amazing-technologies/image/upload/v1552240507/article_thumbnails/bisa_article_thumbnail_1552240506.jpg','Keeping your heart healthy throughout your life is of great importance in reducing your risk of cardiovascular disease, including heart disease and stroke. No matter what your age is, you should always strive to lead a healthy lifestyle by eating a balanced diet, exercising regularly, not smoking and not drinking alcohol excessively. The following tips can help you to keep your heart in shape!\r\n\r\nMaintenir un cœur sain tout à travers votre vie est de grande importance pour réduire votre risque de contracter une maladie cardiovasculaire, y compris la maladie du cœur et l’attaque d’apoplexie. Quel que soit votre âge, vous devez toujours vous efforcer de mener une vie saine en mangeant des repas équilibrés, en faisant régulièrement des exercices physiques, en cessant de fumer et de boire excessivement. Les astuces suivantes peuvent vous aider à garder votre cœur en pleine forme!\r\n\r\nFaites un plan d’alimentation saine\r\nAssurez-vous de manger beaucoup de :\r\n\r\nFruits et légumes\r\nPoissons huileux, par exemple, le saumon, le maquereau, les sardines, le hareng\r\nGrains complets riche en fibre, par exemple, les avoines, l’orge, le maïs, le pop-corn, le riz brun, le boulgour\r\nFruits à coque, légumineuses et graines\r\nEvitez les aliments avec des taux élevés de graisses saturées (par exemple, la beurre, le crème, le yaourt, les viandes grasses), des aliments qui contiennent beaucoup de sodium (des aliments salés), des boissons sucrées (beaucoup des boissons gazeuses), et les viandes rouges. Essayez  chaque semaine de manger quelques repas qui ne contiennent pas de viande.\r\n\r\nGardez la forme et soyez actif\r\nVotre cœur est un muscle alors plus vous êtes actif, plus le cœur sera plus fort et plus sain. Pour améliorer votre santé cardiovasculaire, l’Association Américaine de Cardiologie conseille que vous fassiez au moins 150 minutes d’exercice physique d’intensité modérée chaque semaine ou 75 minutes d’exercice physique épuisante, ou une combinaison des deux.\r\n\r\nComme une manière facile d’incorporer un peu d’exercice physique à votre journée, essayez de vous promener d’un bon pas à votre destination au lieu de conduire ou d’utiliser le transport public, ou de vous promener pour les dernières 20 minutes si c’est un long voyage. Ce n’est jamais trop tard pour commencer à pratiquer un nouveau sport ou un loisir tel que le cyclisme, la course ou la natation.\r\n\r\nL’exercice physique régulier vous aidera à :\r\n\r\nBruler des calories\r\nRéduire le ‘mauvais’ cholestérol\r\nDiminuer votre tension artérielle\r\nMaintenir une vie saine\r\nC’est aussi très important de mener une vie saine dans l’ensemble en vue de maintenir un cœur sain. Cela comprend le fait d’éviter ou d’arrêter de fumer, de ne pas boire des quantités excessives d’alcool, et de prendre soin de votre santé mentale.\r\n\r\nCes trois astuces, en les suivant, sont juste un peu des choses simples que vous pouvez faire pour garder votre cœur sain et content pour plus longtemps!',0,0,0,1,'2019-03-10 17:55:07','2019-03-10 17:55:07'),(11,1,'LE DIABETE DE TYPE 1','https://res.cloudinary.com/amazing-technologies/image/upload/v1559558868/article_thumbnails/bisa_article_thumbnail_1559558867.png','Le diabète de type 1, appelé autrefois diabète insulinodépendant (DID), est habituellement découvert chez les personnes jeunes: enfants, adolescents ou jeunes adultes. Il représente 5 à 10% de tous les cas du diabète. \r\nEn effet, les individus qui sont atteints de diabète de type 1 produisent très peu ou pas du tout d\'insuline en raison d\'une réaction auto-immune qui détruit partiellement ou entièrement les cellules bêta du pancréas. Ces dernières ont pour rôle de synthétiser l’insuline, qui est essentielle à l\'utilisation du glucose sanguin par l\'organisme comme source d\'énergie. L’organisme ne reconnaît plus ces cellules bêta et les détruit (les cellules bêta sont détruites par des anticorps et des cellules de l’immunité, les lymphocytes, fabriquées par l’organisme) : on dit que le diabète de type 1 est une maladie auto-immune. Le glucose ne pouvant entrer dans les cellules retourne dans le sang. Le taux de glucose dans le sang s’élève alors.\r\nSymptômes du diabète de type 1 \r\nAu tout début, le diabète de type 1 ne provoque aucun symptôme, car le pancréas demeure partiellement fonctionnel. La maladie ne devient apparente qu\'au moment où 80 à 90 % des cellules pancréatiques productrices d\'insuline sont déjà détruites. \r\nLes symptômes sont généralement : une soif intense, des urines abondantes, un amaigrissement rapide, une fatigue importante, une vision floue.\r\nCauses du diabète de type 1\r\nOn ignore pourquoi cette destruction des îlots de Langerhans se produit, pourquoi chez certaines personnes et pas chez les autres. Il existe une prédisposition génétique (familiale) mais les autres causes sont mal connues. L’environnement aurait également un rôle. L’exposition à certains virus ou aliments tôt dans la vie pourrait, par exemple, jouer un rôle dans l’apparition de la maladie.\r\nPersonnes à risque\r\n    • Les personnes ayant une prédisposition héréditaire (des antécédents familiaux). Lorsqu’un proche parent est atteint du diabète de type 1 (père, mère, frère ou soeur), le risque de l’avoir aussi oscille entre 5 % et 10 %. Chez de vrais jumeaux, lorsque l’un des deux est atteint, l’autre développe la maladie dans 30 % à 50 % des cas1 ;\r\n    • Comme l\'indiquent des études épidémiologiques, le diabète de type 1 est plus fréquent dans les populations qui vivent à distance de l’Équateur. Ainsi, en Finlande, la maladie est de 2 à 3 fois plus fréquente qu’aux États-Unis, et 400 fois plus qu’au Venezuela2. Un apport insuffisant en vitamine D, dont la fabrication dépend de l’exposition au soleil, pourrait expliquer en partie ce phénomène.\r\n\r\nFacteurs de risque\r\nIl n\'y a pas de facteur de risque établi. Voici quelques hypotheses:\r\n    • Lait de vache. La consommation précoce de lait de vache chez le nourrisson pourrait contribuer à l’apparition d’allergies et du diabète de type 1 chez les enfants ayant des antécédents familiaux de diabète3. Les autorités de santé publique conseillent d’ailleurs de ne pas donner de lait de vache aux nouveau-nés avant l’âge de 12 mois. Le diabète de type 1 est plus rare chez les individus qui ont été allaités;\r\n    • Introduction hâtive des céréales. Une introduction trop précoce des céréales (avant l’âge de 4 mois) pourrait contribuer à la maladie; ne pas en donner au bébé avant l’âge de 6 mois. Respecter l’âge recommandé pour l’introduction des aliments chez un bébé.\r\n    • Infection virale. Une infection au virus Epstein-Barr, au virus Coxsackie ou au cytomégalovirus, par exemple, pourrait déclencher la réaction auto-immune contre le pancréas.\r\n\r\nTraitement du diabète de type 1\r\nLe corps ne fabriquant plus du tout d’insuline, l’unique traitement actuellement est l’apport d’insuline:\r\n    • soit sous forme d’injections (injection d\'insuline avec une seringue ou un stylo),\r\n    • soit avec une pompe à insuline (traitement par pompe), appareil portable ou implantable destiné à administrer l’insuline en continu.\r\nD’autres approches complémentaires du traitement de ce type de diabète sont un régime alimentaire approprié, un programme d’exercices physiques et des moyens pour mieux gérer le stress.\r\nComplications possibles\r\nÀ long terme, le diabète de type 1 accroît le risque de plusieurs problèmes de santé : maladies cardiovasculaires, troubles aux reins, perte de sensibilité aux doigts et aux pieds, problèmes de vision pouvant aller jusqu’à la cécité, etc.\r\n    • Le meilleur moyen de prévenir ces complications est de procéder régulièrement à un contrôle serré de la glycémie, de la tension artérielle et du cholestérol. Pour en savoir plus, consulter notre fiche Complications du diabète.\r\nMesures préventives de base\r\nPour prévenir le diabète de type 1, il faudrait empêcher la destruction des cellules du pancréas responsables de la production d’insuline chez les individus à haut risque d’avoir la maladie. Selon l’Association canadienne du diabète, il n’existe pas encore de méthode efficace et sécuritaire pour prévenir cette maladie, même si on consulte très tôt dans la vie d’un enfant considéré à risque. Par conséquent, toute démarche visant à prévenir le diabète de type 1 devra être faite en collaboration étroite avec un médecin et dans certains cas, dans le cadre d’une étude expérimentale.',0,0,0,1,'2019-06-03 10:47:48','2019-06-03 10:47:48'),(12,2,'LE DIABETE','https://res.cloudinary.com/amazing-technologies/image/upload/v1559559054/article_thumbnails/bisa_article_thumbnail_1559559054.png','Le diabète est un trouble de l’assimilation, de l’utilisation et du stockage des sucres apportés par l’alimentation. Cela se traduit par un taux de glucose dans le sang (encore appelé glycémie) élevé : on parle d’hyperglycémie.\r\nLes aliments sont composés de lipides (graisses), protéines (protéines animales ou végétales) et glucides (sucres, féculents). Ce sont eux qui fournissent l’essentiel de l’énergie dont a besoin le corps pour fonctionner, passent dans l’intestin, puis rejoignent la circulation sanguine.\r\nQuand on mange, le taux de sucre dans le sang augmente, les glucides sont alors transformés essentiellement en glucose. Le pancréas détecte l’augmentation de la glycémie. Les cellules bêta du pancréas, regroupées en amas appelés îlots de Langerhans, sécrètent de l’insuline. L\'insuline fonctionne comme une clé, elle permet au glucose de pénétrer dans les cellules de l’organisme : dans les muscles, dans les tissus adipeux et dans le foie où il va pouvoir être transformé et stocké. Le glucose diminue alors dans le sang. Une autre hormone, le glucagon, permet de libérer le glucose stocké dans le foie, en dehors des repas,  lors d’une baisse énergétique ou d’une baisse de glycémie. \r\nC’est l’équilibre de ces hormones qui permet de maintenir la glycémie stable dans le corps. En cas de diabète, ce système de régulation ne fonctionne pas.\r\nExamen et diagnostic : comment savoir si on a du diabète ?\r\nUn dosage de la glycémie est pratiqué en laboratoire d\'analyses médicales. Un diabète est avéré lorsque la glycémie à jeun est égale ou supérieure à 1.26 g/l à deux reprises ou égale ou supérieure à 2 g/l à n’importe quel moment de la journée.\r\nLes deux types de diabète\r\nOn distingue principalement deux types de diabète : le diabète de type 1 et le diabète de type 2. \r\nDiabète et hérédité\r\nLe poids de l’hérédité diffère selon qu’il s’agit du diabète de type 1 ou du diabète de type 2. Lorsque l’un des deux parents est diabétique de type 2, le risque de transmission à la descendance est de l’ordre de 40 % et si les deux parents sont atteints, le risque grimpe à 70 %. Dans le diabète de type 1, le risque se situe entre 4 et 8%, plus précisément 8 % si le père est diabétique, 4 % si c’est la mère (mais 30 % si les deux parents le sont). Il est donc utile de se construire un arbre généalogique pour repérer les membres de sa famille diabétiques et connaître son patrimoine génétique.\r\nLes complications du diabète\r\nLe but du traitement dans les deux types de diabète est de normaliser la glycémie : les hyperglycémies répétées et prolongées entraînent à long terme une altération des nerfs et des vaisseaux sanguins présents dans tout le corps. Ce sont les complications du diabète qui peuvent se traduire par une cécité, des atteintes des pieds pouvant conduire à des amputations, des infarctus et des accidents vasculaires cérébraux, des troubles de l’érection ou une insuffisance rénale.\r\nLes deux principaux types de diabète sont des maladies différentes mais caractérisées par un excès de sucre dans le sang et doivent être prises au sérieux et traitées efficacement. Il n’y a pas de « petits diabètes » ou de diabètes plus graves que d’autres.\r\nMalgré la recherche médicale qui avance tous les jours, le diabète reste une maladie qui se soigne très bien mais qui ne se guérit pas. Il faut donc, toute sa vie, se surveiller, garder de bonnes habitudes alimentaires, pratiquer une activité physique et prendre régulièrement son traitement. Un diabétique peut donc être un malade en bonne santé ! OUI à la qualité de vie !\r\n\r\nRéférence: https://www.federationdesdiabetiques.org/information/diabete',0,0,0,1,'2019-06-03 10:50:55','2019-06-03 10:50:55'),(13,3,'LE DIABETE DE TYPE 2','https://res.cloudinary.com/amazing-technologies/image/upload/v1559559244/article_thumbnails/bisa_article_thumbnail_1559559244.jpg','Le diabète de type 2 apparaît généralement chez les personnes âgées de plus de 40 ans. Cependant les premiers cas d’adolescents et d’adultes jeunes touchés apparaissent en France.\r\n \r\nLe surpoids, l’obésité et le manque d’activité physique sont la cause révélatrice du diabète de type 2 chez des personnes génétiquement prédisposées. Sournois et indolore, le développement du diabète de type 2 peut passer longtemps inaperçu : on estime qu’il s’écoule en moyenne 5 à 10 ans entre l’apparition des premières hyperglycémies et le diagnostic.\r\nDans le diabète de type 2, autrefois appelé non insulinodépendant (DNID), le processus est différent de celui du diabète de type 1. Deux anomalies sont responsables de l’hyperglycémie:\r\n    • soit le pancréas fabrique toujours de l’insuline mais pas assez, par rapport à la glycémie : c’est l’insulinopénie ;\r\n    • soit cette insuline agit mal, on parle alors d’insulinorésistance.\r\nL\'insuline ne peut plus réguler la glycémie et cette résistance épuise progressivement le pancréas qui finit par ne plus assurer une production suffisante d\'insuline. Ces deux mécanismes font que le glucose ne pénètre pas dans les cellules du corps et reste dans la circulation sanguine. Le taux de glucose dans le sang n’est pas régulé par l’insuline.\r\n\r\nLes causes du diabète de type 2\r\nIl n\'existe pas une cause précise mais un ensemble de facteurs favorisants :\r\n    • une origine génétique : le facteur familial est tout à fait prépondérant. Des antécédents de diabète du même type sont souvent présents dans la famille ;\r\n    • une alimentation déséquilibrée, manque d’activité physique, surpoids...\r\nSymptômes du diabète de type 2\r\n    • Une envie fréquente d’uriner, surtout la nuit. Les reins produisent plus d’urine pour tenter d’éliminer le surplus de glucose dans le sang;\r\n    • Une augmentation de la faim et de la soif, avec une sensation de bouche sèche;\r\n    • Une somnolence excessive qui se remarque surtout après les repas;\r\n    • Une vision trouble;\r\n    • Des infections bactériennes ou à champignon plus fréquentes (infections urinaires, vaginites, etc.)\r\nPersonnes à risque\r\n    • Les personnes dont un parent du premier degré (mère, père, frère ou soeur) est atteint de diabète de type 2;\r\n    • Les personnes obèses ou ayant un surplus de poids, surtout lorsque la masse adipeuse se concentre dans l’abdomen plutôt que sur les hanches et les cuisses. En effet, le gras logé dans les organes de l’abdomen (surtout le foie) est celui qui nuit le plus à la fonction de l’insuline. Plus de 80 % des diabétiques de type 2 ont un excès de poids;\r\n    • Certaines populations sont plus à risque, notamment les Africains, les Latino-américains, les Asiatiques et les populations autochtones d’Amérique du Nord.\r\nFacteurs de risque\r\n    •  Avoir plus de 40 ans. Le diabète de type 2 touche surtout les adultes, et sa prévalence augmente avec l’âge;\r\n    • Avoir un mode de vie sédentaire et consommer trop de calories;\r\n    • Pour les femmes, avoir souffert de diabète gestationnel ou avoir donné naissance à un bébé pesant plus de 4 kg;\r\nQuel est le traitement du diabète de type 2 ?\r\nIl est traité dans un premier temps par des mesures hygiéno-dététiques, puis on a rapidement recours à des traitements antidiabétiques oraux et/ou injectables dont l’efficacité n’est optimale que s’ils sont associés à une alimentation équilibrée et à une activité physique régulière.\r\nLe diabète de type 2 étant une maladie évolutive, après l’augmentation progressive des antidiabétiques (escalade thérapeutique), des injections d’insuline seront proposées en complément au patient lorsque la carence en insuline sera trop importante.\r\nMesures préventives de base\r\nLe diabète de type 2 peut être prévenu par des moyens simples tels que le contrôle du poids, la saine alimentation et des exercices physiques réguliers.\r\nComplications Possibles\r\nÀ long terme, plusieurs diabétiques voient leur état de santé s’aggraver en raison de leur maladie, surtout si le diabète n\'est pas bien contrôlé et suivi. En effet, une glycémie élevée de façon chronique endommage peu à peu les nerfs et les vaisseaux sanguins, principalement aux yeux et aux reins. Le diabète peut ainsi être à l’origine de maladies cardiovasculaires, d’une perte de vision irréversible, de douleurs en raison d’atteintes des nerfs ou d’insuffisance rénale.\r\n\r\nRéférence : \r\nhttps://www.federationdesdiabetiques.org/information/diabete, https://www.passeportsante.net/fr/Maux/Problemes/Fiche.aspx?doc=diabete_type2_pm',0,0,0,1,'2019-06-03 10:54:05','2019-06-03 10:54:05'),(14,1,'LA CONTRACEPTION NATURELLE','https://res.cloudinary.com/amazing-technologies/image/upload/v1559559464/article_thumbnails/bisa_article_thumbnail_1559559464.jpg','La contraception désigne l\'emploi de moyens visant à empêcher qu\'un rapport sexuel entraîne une grossesse. Elle est définie par l\'Organisation mondiale de la santé comme étant « l\'utilisation d’agents, de dispositifs, de méthodes ou de procédures pour diminuer la probabilité de conception ou l’éviter ».\r\nIl existe plusieurs méthodes de contraception, d\'action locale ou générale, à l\'efficacité et aux contraintes variables. \r\nLa conception naturelle, c’est choisir de prévenir une éventuelle grossesse sans matériel quelconque, pour ne pas subir les contraintes des moyens plus ‘traditionnels’ et les effets indésirables des hormones. \r\nIl existe plusieurs méthodes naturelles de contraception : \r\n\r\n    • le retrait : basé sur l\'interruption de l\'acte sexuel avant l\'éjaculation\r\n    • l\'abstinence périodique (qui comprend les méthodes Ogino, Billings et la courbe des températures) : des techniques basées sur la détection de la période fertile du cycle menstruel.\r\nContraignantes, ces méthodes ont un taux d\'échec considéré comme élevé.\r\nLe Retrait\r\nDans ce moyen, L\'homme doit se retirer du vagin de sa partenaire avant d\'avoir éjaculé. Si l\'éjaculation n\'a pas lieu dans le vagin (ni juste à l\'entrée du vagin), cela réduit les risques de grossesse.\r\nOutre le fait qu\'elle ne protège pas d\'éventuelles infections sexuellement transmises, la technique du retrait entraîne un risque de grossesse qui varie de 10 à 22 (indice de Pearl)*. Soit un risque statistique de 10 à 22 grossesses en un an pour cent femmes utilisant cette méthode.\r\nLes échecs du retrait peuvent être expliqués par :\r\n    • la difficulté à contrôler parfaitement l’éjaculation\r\n    • la présence de spermatozoïdes dans le liquide pré-séminal. En effet, les premières gouttes de sperme sortent parfois sans que l\'homme ne les sente : le liquide pré-séminal contient des spermatozoïdes en nombre suffisant pour féconder l\'ovocyte.\r\nLa méthode des températures\r\nCette méthode vise à prendre sa température corporelle chaque matin au lever afin d\'identifier la période de l\'ovulation (caractérisée par une élévation de température de 0,2 à 0,4 °C). Ainsi, en surveillant sa courbe de température, la femme peut éviter d\'avoir des rapports sexuels non protégés en période d\'ovulation.\r\nComme les autres méthodes d\'abstinence périodique, il existe un risque de grossesse qui varie de 8 à 25 (indice de Pearl)*.\r\nLes échecs de cette méthode peuvent être expliqués par le fait que : \r\n    • l\'ovulation peut arriver à n\'importe quel moment\r\n    • les spermatozoïdes peuvent vivre jusqu\'à 5 jours dans l’appareil génital de la femme\r\n    • la température peut monter en cas de maladies ou d\'infections.\r\nLa méthode Ogino\r\nLa méthode Ogino (aussi appelée la méthode du calendrier) vise à calculer la longueur des cycles menstruels afin d\'identifier la période \"fertile\" et ainsi, éviter les rapports sexuels non protégés les jours qui précèdent ou suivent l\'ovulation (soit cinq jours avant l\'ovulation et jusqu\'à deux jours après). \r\nPour utiliser cette méthode, il faut avoir des cycles réguliers (le même nombre de jours entre deux périodes de règles). Or, l\'ovulation ne survient pas toujours au même moment (même chez les femmes dont le cycle est \"régulier\"). Il est donc impossible de prévoir le jour exact de l\'ovulation. C\'est d\'autant plus vrai au moment de la puberté et à l\'approche de la ménopause.\r\nComme les autres méthodes d\'abstinence périodique, il existe un risque de grossesse qui varie de 8 à 25 (indice de Pearl)*.\r\nLa méthode Billings\r\nCette méthode vise à observer les modifications de la glaire cervicale sécrétée par le col utérin durant le cycle pour identifier la période d\'ovulation et ainsi éviter les rapports sexuels non protégés à ce moment-là.  En effet, à l\'approche de l\'ovulation la glaire cervicale se modifie. Elle devient plus abondante, plus fluides et provoquent un écoulement vaginal (ou \"pertes blanches\").\r\n\r\nPlusieurs facteurs peuvent modifier l\'aspect de la glaire cervicale comme une inflammation vaginale, une prise de traitement hormonal, l’excitation, etc. De plus, cette technique demande d\'être à l\'aise avec les manipulations vaginales, car il faut mettre ses doigts dans le vagin pour pouvoir observer la glaire cervicale. \r\nComme les autres méthodes d\'abstinence périodique, il existe un risque de grossesse qui varie de 8 à 25 (indice de Pearl)*.\r\n\r\nLa méthode de l’allaitement\r\n\r\nLa Méthode de l\'Allaitement Maternel et de l\'Aménorrhée, également appelée méthode MAMA, repose sur l\'effet \"contraceptif\" de l\'allaitement maternel. En effet, en cas d\'allaitement, la succion du sein par le bébé provoque la libération de prolactine (une hormone) chez la maman qui permet de produire du lait. Or, la fabrication de prolactine retarde l\'ovulation.\r\nEn théorie, l\'allaitement maternel peut donc retarder la date de la première ovulation après l\'accouchement. Il peut donc être un moyen de contraception, mais uniquement si :\r\n    • l\'allaitement est exclusif (sans biberon de lait maternisé ou alimentation diversifiée par ailleurs)\r\n    • l\'allaitement est à la demande, jour et nuit\r\n    • et si les règles sont absentes depuis l\'accouchement.\r\nEn réalité, il est impossible de prédire la date d\'ovulation à coup sûr. Il est donc dangereux de se fier à cette méthode.\r\n\r\nRéférence: \r\nhttps://fr.wikipedia.org/wiki/Contraception, http://www.doctissimo.fr/html/sexualite/femmes/se_1109_pt_naturel.htm',0,0,0,1,'2019-06-03 10:57:44','2019-06-03 10:57:44');
