INSERT INTO `doctors` VALUES (3,'Dr','Ibrahima','Cisse','male','Cote D\"Ivoire','n/a','n/a','cisse@bisa.fr','cisse','$2y$10$9aZMYcBSY3niOLZJsqohK.uhCFgvgkBabz8rY8H5w9RF/SBcKDPiy','Dr. Ibrahima Cisse est un jeune médecin dynamique et motivé. Il est titulaire d’un Master 2 de la Faculté de Médecine, de Pharmacie et d’Odontostomatologie de l’Université Cheik Anta Diop, Dakar. Il fait actuellement son stage dans les Centres Hospitaliers Universitaires de Dakar où il réalise des tâches telles que la consultation, l’hospitalisation, le traitement et le suivi des maladies en rapport avec ces spécialités-ci: la cardiologie, l’infectiologie, la chirurgie générale, la gynécologie, la pédiatrie, la médecine interne, la pneumatologie, la neurologie, l’orthopédie et l’urologie. Il aime tout ce qui touche de près ou de loin à la santé et au bien-être des patients. Aussi, il aime le sport, la lecture et le cinéma.','https://res.cloudinary.com/amazing-technologies/image/upload/v1556550671/doctor_thumbnails/bisa_doctor_thumbnail_1556550671.png',1,'2019-04-29 15:11:12','2019-04-29 15:11:12'),(4,'Dr','Nana Serwaa','Agyeman Quao','female','Ghana','n/a','n/a','nanakwao@bisa.fr','nanakwao','$2y$10$HZh/A72VjrtjEKaEnBJ.IeuUFaDI5mt41E1N1GBVkpIi1zQV73GWW','Dr. Nana Serwaa Agyeman Quao est une résidente de deuxième année au Département de\r\nMédecine d’Urgence à l’Hôpital Universitaire Komfo Anokye, Kumasi, Ghana. Elle est un\r\nmédecin dédié ayant la passion de voir la prestation des services améliorées de soins\r\nd’urgence au public. Au département, elle joue un rôle dans un nombre de recherches\r\ncliniques ayant pour objectif l’avancement de la prestation des soins d’urgence ainsi que\r\nl’amélioration du système de soin médical. Elle espère poursuivre une carrière à longue terme\r\ndans le domaine des soins médicaux avec des opportunités pour l’avancement professionnel.','https://res.cloudinary.com/amazing-technologies/image/upload/v1559558371/doctor_thumbnails/bisa_doctor_thumbnail_1559558370.png',1,'2019-06-03 10:39:32','2019-06-03 10:39:32'),(5,'Dr','Lawrence','Osei Tutu','male','Ghana','n/a','n/a','lawrence@bisa.fr','oseitutu','$2y$10$4K3defw90luKcheBB4wD4OH8J0N1Z9U7QkcFXet9ECIYULi0gWg3e','Dr. Lawrence Osei Tutu - En tant que médecin ghanéen, qui se spécialise en Pédiatrie\r\nGénérale, formé au Ghana, passionné, innovateur et orienté vers la prestation des solutions,\r\nDr. Lawrence Osei-Tutu s’est familiarisé avec les besoins médicaux divers de l’enfant\r\nghanéen et ceux qui s’occupent de lui ou d’elle; en leur prêtant des solutions médicaux à\r\ntravers l’industrie, le plaidoyer et la propagation de la connaissance et des compétences\r\nmédicales par le biais de la formation clinique des étudiants en médecine. Il vise à être\r\nSpécialiste compétent en Hématologie-Oncologie Pédiatrique, Professeur, Promoteur de la\r\nSanté et Chercheur Universitaire capable de pratiquer et d’enseigner au sein de et en dehors\r\nde l’Afrique. Il aime les arts, surtout la musique classique et chorale; l’organisation et la\r\ncoordination de tels événements en tant que maître de cérémonie lui donnent beaucoup de\r\njoie.','https://res.cloudinary.com/amazing-technologies/image/upload/v1559558489/doctor_thumbnails/bisa_doctor_thumbnail_1559558488.jpg',1,'2019-06-03 10:41:30','2019-06-03 10:41:30'),(6,'Rd','Salomey','Kokoro','female','Afghanistan','n/a','n/a','salomey@bisa.fr','salomey','$2y$10$pH5WPku1SyeHKc2CSIGit.5Gqz/uFv6ZXj2IbP7g1lYzSx7Q5qM/m','Rd. Salomey Kokoro est une diététiste professionnelle passionnée par la promotion de la\r\nsanté et de la nutrition en rapport avec les maladies liées au mode de vie et la santé publique.\r\nElle a coordonné et participé à de nombreux exercices de dépistage de la nutrition pour les\r\ncommunautés défavorisées, ainsi qu&#39;à des organismes de coopération. Ayant déjà travaillé à\r\nl&#39;Hôpital régional Ridge, Salomey est actuellement diététiste clinicienne au Claron Medical\r\nCenter.\r\nSelon elle, il est extrêmement gratifiant de voir de nombreuses personnes et familles\r\naméliorer leur santé par le biais d&#39;une alimentation saine et d&#39;une modification du mode de\r\nvie.','https://res.cloudinary.com/amazing-technologies/image/upload/v1559558574/doctor_thumbnails/bisa_doctor_thumbnail_1559558573.png',1,'2019-06-03 10:42:55','2019-06-03 10:42:55');
